pragma solidity ^0.5.0;

import "./zeppelin/Ownable.sol";

contract ProformaServiceInterface{
    function checkifTransactIdExist(uint) public view returns (uint);

}

contract Items is Ownable{


  uint private idDigits = 17;
  uint private idModulus = 10 ** idDigits;

  struct Item{
    uint32 quantity;
    string description;
    string measures;
    string weight;
    uint64 commercialValue;
    uint64 serviceValue;
    uint idTransaction;
    uint date;
  }

  ProformaServiceInterface proformaServiceContract;

  mapping (uint => uint) itemsByTransactionCount;

  Item[] items;

  function setProformaServiceContractAddress(address _address) public onlyOwner  {
    proformaServiceContract = ProformaServiceInterface(_address);
  }

  function getProformaServiceContractAddress() public view onlyOwner returns (ProformaServiceInterface) {
    return proformaServiceContract;
  }

  function registerItem(uint32 _quantity, string memory _description, string memory _measures,
  string memory _weight, uint64 _commercialValue, uint64 _serviceValue, uint _idTransaction) public onlyOwner {

      uint existId = proformaServiceContract.checkifTransactIdExist(_idTransaction);
      require(existId != 0);

      items.push(Item({
          quantity: _quantity,
          description: _description,
          measures: _measures,
          weight: _weight,
          commercialValue: _commercialValue,
          serviceValue: _serviceValue,
          idTransaction: _idTransaction,
          date: now
      }));

      itemsByTransactionCount[_idTransaction]++;

      emit newItemRegistered(_quantity,_description,_measures,_weight,_commercialValue,_serviceValue,_idTransaction);

  }

  function getitemById(uint _id) public view returns(uint32, string memory, string memory,
    string memory, uint64, uint64, uint, uint){
     Item memory item = items[_id];
     return(
         item.quantity,
         item.description,
         item.measures,
         item.weight,
         item.commercialValue,
         item.serviceValue,
         item.idTransaction,
         item.date
     );
 }

  function getItemsIdsByTransaction(uint _transaction) public view returns( uint[] memory ){

      uint[] memory idsItem = new uint[](itemsByTransactionCount[_transaction]);

      uint count = 0;

      for(uint i=0; i<items.length ; i++)
      {
          if(items[i].idTransaction ==  _transaction)
          {
              idsItem[count] = i;
              count++;
          }

      }

      return idsItem;
  }

  function totalItems() public view returns(uint)
  {
      return items.length;
  }

  event newItemRegistered(uint quantity, string description, string measures, string weight,
  uint commercialValue, uint serviceValue, uint idTransaction);

}
